import React from "react";
import "../styles/Navbar.css";
const Navbar = () => {
  return (
    <div className="header">
      <div className="h-item h-home">TV-flights</div>
      <div className="h-auth">
        <button className="h-item h-auth-btn h-login">Login</button>
        <button className="h-item h-auth-btn h-register">Register</button>
      </div>
    </div>
  );
};

export default Navbar;
